    fr: "Cette étude nécessite une fenêtre en mode incognito/privé, et cette fenêtre ne l'est pas. Vous pouvez corriger cela. En utilisant n'importe quel navigateur autre que Safari, ouvrez une fenêtre en mode incognito et exécutez le lien de l'étude dans cette fenêtre.\n\nEXPLICATION : Tous les principaux navigateurs vous permettent d'ouvrir une fenêtre en mode incognito, bien que le nom varie, par exemple « Incognito », « InPrivate », « Navigation privée » ou « Fenêtre privée ». Tous les navigateurs sauf Safari indiquent si la page web est en mode incognito. Safari indique toujours non. Le mode incognito est généralement utilisé pour la confidentialité. EasyEyes l'utilise pour faciliter l'accès à la bibliothèque Firebase de EasyEyes, nécessaire pour la calibration du son.",
    de: '"Diese Studie benötigt ein Inkognito-/Privatfenster, und dieses Fenster ist es nicht. Du kannst das beheben. Öffne mit einem beliebigen Browser außer Safari ein Inkognito-Fenster und führe den Studienlink in diesem Fenster aus.\n\nERKLÄRUNG: Alle gängigen Browser ermöglichen das Öffnen eines Fensters im Inkognito-Modus, obwohl der Name variieren kann, z.B. "Inkognito", "InPrivate", "Privates Browsen" oder "Privates Fenster". Alle Browser außer Safari geben an, ob die Webseite im Inkognito-Modus ist. Safari sagt immer nein. Der Inkognito-Modus wird in der Regel für Datenschutz verwendet. EasyEyes verwendet ihn, um den Zugriff auf die EasyEyes Firebase-Bibliothek zu erleichtern, die für die Klangkalibrierung benötigt wird."',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: '\nQuesto studio necessita di una finestra in incognito/privata, e questa finestra non lo è. Puoi risolvere questo problema. Utilizzando un qualsiasi browser diverso da Safari, apri una finestra in incognito e avvia il link dello studio in quella finestra.\n\nSPIEGAZIONE: Tutti i principali browser permettono di aprire una finestra in modalità incognito, anche se il nome può variare, ad esempio "Incognito", "InPrivate", "Navigazione Privata" o "Finestra Privata". Tutti i browser tranne Safari indicano se la pagina web è in modalità incognito. Safari dice sempre di no. La modalità incognito è tipicamente utilizzata per la privacy. EasyEyes la utilizza per facilitare l\'accesso alla libreria Firebase di EasyEyes, necessaria per la calibrazione del suono.',
    ja: 'Loading...',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: '"Šiam tyrimui reikalingas inkognito / privatus langas, o šis langas toks nėra. Galite tai pataisyti. Naudodami bet kurį naršyklės, išskyrus Safari, atidarykite inkognito langą ir paleiskite tyrimo nuorodą tame lange.\n\nPAAIŠKINIMAS: Visos pagrindinės naršyklės leidžia atidaryti langą inkognito režimu, nors pavadinimas gali skirtis, pvz., "Incognito", "InPrivate", "Private Browsing" arba "Private Window". Visos naršyklės, išskyrus Safari, praneša, ar tinklalapis yra inkognito režime. Safari visada sako ne. Inkognito režimas paprastai naudojamas privatumui. EasyEyes jį naudoja, kad būtų lengviau pasiekti EasyEyes Firebase biblioteką, kuri reikalinga garsų kalibravimui."',
    ms: 'Loading...',
    ml: 'Loading...',
    no: '"Dette studiet trenger et inkognitovindu, og dette vinduet er det ikke. Du kan fikse dette. Bruk en hvilken som helst nettleser annet enn Safari, åpne et inkognitovindu og kjør studielinken i det vinduet.\n\nFORKLARING: Alle større nettlesere lar deg åpne et vindu i inkognitomodus, selv om navnet varierer, f.eks. "Inkognito", "InPrivate", "Privat nettlesing" eller "Privat vindu". Alle nettlesere bortsett fra Safari rapporterer om nettsiden er i inkognitomodus. Safari sier alltid nei. Inkognitomodus brukes vanligvis for personvern. EasyEyes bruker det for å lette tilgangen til EasyEyes Firebase-biblioteket, som er nødvendig for lydkalibrering."',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Ova studija zahteva inkognito/privatni prozor, a ovaj prozor to nije. Možete to popraviti. Koristeći bilo koji pregledač osim Safarija, otvorite inkognito prozor i pokrenite link studije u tom prozoru.\n\nOBJAŠNJENJE: Svi glavni pregledači vam omogućavaju otvaranje prozora u inkognito režimu, iako se naziv može razlikovati, na primer "Incognito", "InPrivate", "Private Browsing" ili "Private Window". Svi pregledači osim Safarija prijavljuju da li je web stranica u inkognito režimu. Safari uvek kaže ne. Inkognito režim se obično koristi radi privatnosti. EasyEyes ga koristi radi olakšanog pristupa EasyEyes Firebase biblioteci, koja je potrebna za kalibraciju zvuka.\n',
    es: 'Este estudio necesita una ventana en modo incógnito/privado, y esta ventana no lo está. Puedes solucionarlo. Usando cualquier navegador excepto Safari, abre una ventana en modo incógnito y ejecuta el enlace del estudio en esa ventana.\n\nEXPLICACIÓN: Todos los principales navegadores te permiten abrir una ventana en modo incógnito, aunque el nombre varía, por ejemplo, “Incógnito”, “InPrivate”, “Navegación Privada” o “Ventana Privada”. Todos los navegadores excepto Safari informan si la página web está en modo incógnito. Safari siempre dice que no. El modo incógnito se utiliza típicamente para la privacidad. EasyEyes lo usa para facilitar el acceso a la biblioteca Firebase de EasyEyes, que es necesaria para la calibración del sonido.',
    sw: '"Utafiti huu unahitaji dirisha la siri/incognito, na dirisha hili haliko. Unaweza kusahihisha hili. Kutumia kivinjari kingine isipokuwa Safari, fungua dirisha la siri, na endesha kiungo cha utafiti katika dirisha hilo.\n\nMAELEZO: Vivinjari vyote vikuu huruhusu kufungua dirisha katika hali ya siri, ingawa jina linatofautiana, kama vile "Incognito", "InPrivate", "Private Browsing", au "Private Window". Vivinjari vyote isipokuwa Safari hutoa ripoti ikiwa ukurasa wa wavuti uko katika hali ya siri. Safari daima inasema la. Hali ya siri kawaida hutumiwa kwa faragha. EasyEyes inaitumia kufanya iwe rahisi kupata maktaba ya EasyEyes Firebase, ambayo inahitajika kwa kalibrering ya sauti."',
    sv: '"Denna studie behöver ett inkognito/privat fönster, och det här fönstret är det inte. Du kan fixa detta. Använd vilken webbläsare som helst förutom Safari, öppna ett inkognito-fönster och kör studielänken i det fönstret.\n\nFÖRKLARING: Alla stora webbläsare tillåter dig att öppna ett fönster i inkognitoläge, även om namnet varierar, t.ex. "Incognito", "InPrivate", "Privat surfning" eller "Privat fönster". Alla webbläsare utom Safari rapporterar om webbsidan är i inkognitoläge. Safari säger alltid nej. Inkognitoläge används vanligtvis för integritet. EasyEyes använder det för att underlätta åtkomst till EasyEyes Firebase-bibliotek, som behövs för ljudkalibrering."',
    tl: 'Loading...',
    tr: 'Loading...',
    ur: '"اس مطالعے کو ایک ناشناختہ / نجی ونڈو کی ضرورت ہوتی ہے اور یہ ونڈو نہیں ہے۔ آپ اس کو درست کر سکتے ہیں۔ سفاری کے علاوہ کسی بھی براؤزر کا استعمال کرتے ہوئے، ایک ناشناختہ ونڈو کھولیں اور اس ونڈو میں مطالعے کا لنک چلائیں.\n\nوضاحت: تمام بڑے براؤزرز آپ کو ناشناختہ موڈ میں ایک ونڈو کھولنے کی اجازت دیتے ہیں، حالانکہ نام مختلف ہوتا ہے، مثلاً "ناشناختہ"، "ان پرائیویٹ"، "پرائیویٹ براؤزنگ" یا "پرائیویٹ ونڈو". سب براؤزرز کے علاوہ سفاری رپورٹ کرتے ہیں کہ ویب پیج ناشناختہ موڈ میں ہے یا نہیں۔ سفاری ہمیشہ نہیں کہتا ہے۔ ناشناختہ موڈ عموماً خصوصیت کے لئے استعمال ہوتا ہے۔ EasyEyes اسے آسانی سے رسائی حاصل کرنے کے لئے استعمال کرتا ہے، جو آواز کی کیلیبریشن کے لئے ضروری ہوتا ہے۔"',
