    hr: 'Loading...',
    cs: 'Loading...',
    da: 'Loading...',
    nl: 'Loading...',
    'en-UK': 'Loading...',
    fi: 'Loading...',
    fr: "Comme indiqué dans sa description, cette étude nécessite une fenêtre en mode incognito/privé, et cette fenêtre ne l'est pas. Vous pouvez corriger cela. En utilisant n'importe quel navigateur autre que Safari, ouvrez une fenêtre en mode incognito et exécutez le lien de l'étude dans cette fenêtre.\n\nEXPLICATION : Tous les principaux navigateurs vous permettent d'ouvrir une fenêtre en mode incognito, bien que le nom varie, par exemple « Incognito », « InPrivate », « Navigation privée » ou « Fenêtre privée ». Tous les navigateurs sauf Safari indiquent si la page web est en mode incognito. Safari dit toujours non. Le mode incognito est généralement utilisé pour la confidentialité. EasyEyes l'utilise pour faciliter l'accès à la bibliothèque Firebase de EasyEyes, nécessaire pour la calibration du son.",
    de: 'Loading...',
    el: 'Όπως αναφέρεται στην περιγραφή του, αυτή η μελέτη χρειάζεται ένα παράθυρο ανώνυμης/ιδιωτικής περιήγησης, και αυτό το παράθυρο δεν είναι. Μπορείτε να το διορθώσετε. Χρησιμοποιώντας οποιονδήποτε περιηγητή εκτός από το Safari, ανοίξτε ένα παράθυρο ανώνυμης περιήγησης και εκτελέστε τον σύνδεσμο της μελέτης σε αυτό το παράθυρο. \n\nΕΞΗΓΗΣΗ: Όλοι οι μεγάλοι περηγητές σάς επιτρέπουν να ανοίξετε ένα παράθυρο σε λειτουργία ανώνυμης περιήγησης, αν και η ονομασία διαφέρει, π.χ. "Ανώνυμη", "Ιδιωτική", "Ιδιωτική περιήγηση" ή "Ιδιωτικό παράθυρο". Όλοι οι περηγητές εκτός από το Safari αναφέρουν εάν η ιστοσελίδα βρίσκεται σε λειτουργία ανώνυμης περιήγησης. Το Safari λέει πάντα όχι. Η λειτουργία ανώνυμης περιήγησης χρησιμοποιείται τυπικά για την ιδιωτικότητα. Το EasyEyes τη χρησιμοποιεί για να διευκολύνει την πρόσβαση στη βιβλιοθήκη Firebase του EasyEyes, η οποία χρειάζεται για τη βαθμονόμηση του ήχου.',
    he: 'Loading...',
    hi: 'Loading...',
    hu: '"Mint a leírásában is szerepel, ehhez a tanulmányhoz egy inkognitó/privát ablakra van szükség, és ez az ablak nem az. Ezt meg lehet javítani. Használj bármilyen más böngészőt, mint a Safari, nyiss meg egy inkognitó ablakot, és futtasd le a tanulmány linkjét abban az ablakban.\n\nMAGYARÁZAT: Az összes nagy böngésző lehetővé teszi, hogy inkognitó módban nyissunk meg egy ablakot, bár a név változhat, például "Incognito", "InPrivate", "Private Browsing" vagy "Private Window". Az összes böngésző kivéve a Safari jelzi, hogy a weboldal inkognitó módban van-e. A Safari mindig azt mondja, hogy nem. Az inkognitó mód általában a magánszférához használatos. Az EasyEyes ezt használja az EasyEyes Firebase könyvtár könnyű hozzáféréséhez, amelyre a hangkalibráláshoz van szükség."',
    is: 'Loading...',
    id: 'Loading...',
    it: 'Come indicato nella sua descrizione, questo studio richiede una finestra in incognito/privata, e questa finestra non lo è. Puoi risolvere questo problema. Utilizzando un browser diverso da Safari, apri una finestra in incognito e avvia il link dello studio in quella finestra.\n\nSPIEGAZIONE: Tutti i principali browser consentono di aprire una finestra in modalità incognito, anche se il nome varia, ad esempio "Incognito", "InPrivate", "Navigazione Privata" o "Finestra Privata". Tutti i browser tranne Safari segnalano se la pagina web è in modalità incognito. Safari dice sempre di no. La modalità incognito è tipicamente utilizzata per la privacy. EasyEyes la utilizza per facilitare l\'accesso alla libreria Firebase di EasyEyes, necessaria per la calibrazione del suono.',
