    hr: 'Loading...',
    cs: 'Loading...',
    da: 'Loading...',
    nl: 'Loading...',
    'en-UK': 'Loading...',
    fi: 'Loading...',
    fr: '\nVOTRE TÉLÉPHONE Android. Nous avons besoin de détails spécifiant sa marque et son modèle. Allez dans Paramètres > À propos du téléphone (anciennement "À propos de l\'appareil").\nPOUR SAMSUNG GALAXY : Copiez le grand titre "Galaxy ..." dans Nom du Modèle ci-dessous, et copiez le Numéro de Modèle dans Numéro de Modèle ci-dessous.\nPOUR MOTO G : Le nom du modèle et le (numéro) sont combinés en une seule ligne appelée "Modèle". Copiez le nom (à l\'extérieur des parenthèses) dans Nom du Modèle ci-dessous. Copiez le numéro entre parenthèses, qui peut inclure des lettres et des chiffres, dans Numéro de Modèle ci-dessous.\nPOUR TOUT AUTRE TÉLÉPHONE : Copiez le "Nom du Produit" dans Nom du Modèle ci-dessous. Copiez "Nom du Modèle" dans Numéro de Modèle ci-dessous.\n',
    de: 'Loading...',
    el: 'ΤΟ Android ΤΗΛΕΦΩΝΟ ΣΑΣ. Χρειαζόμαστε λεπτομέρειες που καθορίζουν το brand και το μοντέλο του. Πηγαίνετε στις Ρυθμίσεις > Σχετικά με το τηλέφωνο (πρώην "Σχετικά με τη συσκευή").\nΓΙΑ SAMSUNG GALAXY: Αντιγράψτε το μεγάλο κείμενο "Galaxy ..." στο Όνομα Μοντέλου παρακάτω και αντιγράψτε τον Αριθμό Μοντέλου στον Αριθμό Μοντέλου παρακάτω.\nΓΙΑ MOTO G: Το όνομα και το (αριθμός) του μοντέλου συνδυάζονται σε μια γραμμή που ονομάζεται "Μοντέλο". Αντιγράψτε το όνομα (έξω από τις παρενθέσεις) στο Όνομα Μοντέλου παρακάτω. Αντιγράψτε τον αριθμό στις παρενθέσεις, ο οποίος μπορεί να περιλαμβάνει γράμματα και ψηφία, στον Αριθμό Μοντέλου παρακάτω.\nΓΙΑ ΟΠΟΙΟΔΗΠΟΤΕ ΑΛΛΟ ΤΗΛΕΦΩΝΟ: Αντιγράψτε το "Όνομα Προϊόντος" στο Όνομα Μοντέλου παρακάτω. Αντιγράψτε το "Όνομα Μοντέλου" στον Αριθμό Μοντέλου παρακάτω.',
    he: 'Loading...',
    hi: 'आपका एंड्रॉयड फोन। हमें इसके ब्रांड और मॉडल के बारे में विवरण चाहिए। सेटिंग्स पर जाएं > फोन के बारे में (पहले से "डिवाइस के बारे में")। \nसैमसंग गैलेक्सी के लिए: "गैलेक्सी ..." को मॉडल नाम के नीचे कॉपी करें, और मॉडल नंबर को मॉडल नंबर के नीचे कॉपी करें। \nमोटो जी के लिए: मॉडल नाम और (नंबर) को "मॉडल" नामक एक पंक्ति में मिलाया जाता है। नाम (बाहरी ब्रैकेट के बाहर) को मॉडल नाम के नीचे कॉपी करें। ब्रैकेट में शामिल अक्षर और अंकों की संख्या को मॉडल नंबर के नीचे कॉपी करें। \nकिसी अन्य फोन के लिए: "उत्पाद नाम" को मॉडल नाम के नीचे कॉपी करें। "मॉडल नाम" को मॉडल नंबर के नीचे कॉपी करें।',
    hu: '"AZ Ön Android TELEFONJA. Részletekre van szükségünk a márka és modell megadásához. Menjen a Beállítások > Telefonról (korábban "Eszközről") részre. \nSAMSUNG GALAXY ESETÉN: Másolja a nagy "Galaxy ..." címsort a Modellnév alá, és másolja a Modellszámot a Modellszám alá. \nMOTO G ESETÉN: A modellnév és (szám) egy sorban található, amit "Modell" néven hívnak. Másolja a nevet (a zárójel kívül) a Modellnév alá. Másolja a zárójelben szereplő számot, amely betűket és számokat is tartalmazhat, a Modellszám alá.\nBÁRMILYEN MÁS TELEFON ESETÉN: Másolja a "Termék nevét" a Modellnév alá. Másolja a "Modell nevét" a Modellszám alá."',
    is: 'Loading...',
    id: 'Loading...',
    it: '\nIL TUO TELEFONO Android. Abbiamo bisogno di dettagli che specificano il marchio e il modello. Vai su Impostazioni > Informazioni sul telefono (precedentemente "Informazioni sul dispositivo").\nPER SAMSUNG GALAXY: Copia l\'intestazione grande "Galaxy ..." in Nome Modello qui sotto, e copia il Numero Modello in Numero Modello qui sotto.\nPER MOTO G: Il nome del modello e il numero (tra parentesi) sono combinati in una sola riga chiamata "Modello". Copia il nome (fuori dalle parentesi) in Nome Modello qui sotto. Copia il numero tra parentesi, che può includere lettere e cifre, in Numero Modello qui sotto.\nPER QUALSIASI ALTRO TELEFONO: Copia il "Nome Prodotto" in Nome Modello qui sotto. Copia "Nome Modello" in Numero Modello qui sotto.\n',
