    ja: '「あなたのMotorolaの携帯電話です。モデルを特定するための詳細が必要です。設定に移動し、電話について（以前は「デバイスについて」と呼ばれていました）を選択してください。モデルの名前と（番号）は、「モデル」という1行に結合されます。括弧の前の名前を下のモデル名にコピーしてください。括弧内の文字と数字を下のモデル番号にコピーしてください。」',
