    fr: '\nVOTRE téléphone Blackberry. Nous avons besoin de détails spécifiant son modèle. Allez dans Paramètres > À propos du téléphone (anciennement "À propos de l\'appareil"). Le NOM du modèle et le (NUMÉRO) sont combinés en une seule ligne appelée "Modèle". Copiez le nom avant les parenthèses dans Nom du modèle ci-dessous. Copiez les lettres et les chiffres à l\'intérieur des parenthèses dans Numéro du modèle ci-dessous.\n',
    de: 'Loading...',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'A Blackberry TELEFONOD. Részletekre van szükségünk a modelljével kapcsolatban. Menj a Beállítások > Telefonról (korábban "Eszközről" ) részhez. A modell NEVE és (SZÁMA) egy sorban vannak egyesítve, amit "Modell" néven találsz. Másold ki a nevet a zárójelek előtt, és illeszd be a Modell neve részbe. Másold ki a betűket és számokat a zárójelek között, és illeszd be a Modell szám részbe.',
    is: 'Loading...',
