    no: 'Loading...',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: 'SEU TELEFONE Blackberry. Precisamos de detalhes especificando o modelo. Vá para Configurações > Sobre o telefone (anteriormente "Sobre o dispositivo"). O NOME do modelo e (NÚMERO) são combinados em uma linha chamada "Modelo". Copie o nome antes dos parênteses para o campo Nome do modelo abaixo. Copie as letras e números dentro dos parênteses para o campo Número do modelo abaixo.',
    ro: 'Loading...',
    ru: '"ВАШ телефон Blackberry. Нам нужны подробности, указывающие его модель. Перейдите в Настройки > О телефоне (ранее "О устройстве"). Название модели и (НОМЕР) объединены в одну строку, называемую "Модель". Скопируйте название перед скобками в поле "Название модели" ниже. Скопируйте буквы и цифры внутри скобок в поле "Номер модели" ниже."',
    sr: 'Loading...',
    es: '"SU teléfono Blackberry. Necesitamos detalles que especifiquen su modelo. Vaya a Configuración > Acerca del teléfono (anteriormente "Acerca del dispositivo"). El NOMBRE del modelo y el (NÚMERO) se combinan en una línea llamada "Modelo". Copie el nombre antes de los paréntesis en Nombre del modelo a continuación. Copie las letras y números dentro de los paréntesis en Número de modelo a continuación."',
    sw: 'Loading...',
    sv: 'Loading...',
    tl: '"Yung iyong Blackberry PHONE. Kailangan namin ng mga detalye na nagtatakda ng modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono (dating "Tungkol sa aparato"). Ang pangalan ng modelo at (bilang) ay pinagsama-sama sa isang linya na tinatawag na "Modelo". Kopyahin ang pangalan bago ang mga panaklong sa ibaba ng Pangalan ng Modelo. Kopyahin ang mga titik at numero sa loob ng mga panaklong sa ibaba ng Numero ng Modelo."',
    tr: '"Blackberry TELEFONUNUZ. Modelini belirten ayrıntılara ihtiyacımız var. Ayarlar\'a gidin > Telefon hakkında (eski adıyla "Cihaz hakkında"). Model ADI ve (NUMARA) "Model" adı verilen bir satırda birleştirilir. Parantezlerin içindeki ismi Model adı alanına kopyalayın. Parantezlerin içindeki harfleri ve sayıları Model numarası alanına kopyalayın."',
    ur: 'Loading...',
