    es: 'SU COMPUTADORA Linux. Necesitamos detalles que especifiquen su marca y modelo. El modelo se encuentra de diferentes maneras en diferentes sistemas Linux. Una es mirar el archivo\n/sys/devices/virtual/dmi/id/product_name\nCopie el Nombre y Número del Modelo en los campos correspondientes a continuación.',
