    is: "ÞINN WebOS SÍMI. Við þurfum upplýsingar sem tilgreina módelið. Fara í stillingar eða valkosti valmyndina, skruna niður í listanum og athuga 'Um símann', 'Um tækið' eða eitthvað svipað. Afrita módelheitið og númerið í viðeigandi reiti hér að neðan.",
    id: 'Loading...',
    it: "IL TUO TELEFONO WebOS. Abbiamo bisogno di dettagli che specificano il suo modello. Vai al menu Impostazioni o Opzioni, scorri fino in fondo alla lista e controlla 'Informazioni sul telefono', 'Informazioni sul dispositivo' o simili. Copia il Nome e il Numero del Modello nei campi corrispondenti qui sotto.",
    ja: 'Loading...',
    kn: "ನಿಮ್ಮ WebOS ಫೋನ್. ಅದರ ಮಾದರಿಯನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ವಿವರಗಳು ನಮಗೆ ಬೇಕಾಗಿದೆ. ಸೆಟ್ಟಿಂಗ್ಗೆ ಅಥವಾ ಆಯ್ಕೆಗಳ ಮೆನುವಿಗೆ ಹೋಗಿ, ಪಟ್ಟಿಯ ಕೆಳಗೆ ಸ್ಕ್ರೋಲ್ ಮಾಡಿ, 'ಫೋನ್ ಬಗ್ಗೆ', 'ಸಾಧನದ ಬಗ್ಗೆ' ಅಥವಾ ಇತರ ಸಮಾನವನ್ನು ಪರಿಶೀಲಿಸಿ. ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆಯನ್ನು ಕಳೆದಿರುವ ಕೆಳಗಿನ ಕ್ಷೇತ್ರಗಳಿಗೆ ನಕಲಿಸಿ.",
    ko: 'Loading...',
    lt: 'Loading...',
    ms: "TELEFON WebOS ANDA. Kami memerlukan butiran yang menentukan modelnya. Pergi ke menu Tetapan atau Pilihan, gulir ke bahagian bawah senarai, dan periksa 'Mengenai telefon', 'Mengenai peranti' atau seumpamanya. Salin Nama Model dan Nombor ke medan yang sepadan di bawah.",
    ml: 'Loading...',
    no: 'Loading...',
    fa: "تلفن WebOS شما. ما به جزئیات مربوط به مدل آن نیاز داریم. به منوی تنظیمات یا گزینه ها بروید، به پایین لیست حرکت کنید و گزینه 'درباره تلفن'، 'درباره دستگاه' یا مشابه آن را بررسی کنید. نام مدل و شماره را به فیلدهای مربوطه زیر کپی کنید.",
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: "SU teléfono WebOS. Necesitamos detalles que especifiquen su modelo. Vaya al menú de Configuración o Opciones, desplácese hasta el final de la lista y revise 'Acerca del teléfono', 'Acerca del dispositivo' o similar. Copie el Nombre y Número del Modelo en los campos correspondientes a continuación.",
    sw: 'Loading...',
    sv: "DIN WebOS-TELEFON. Vi behöver detaljer som specificerar dess modell. Gå till Inställningar eller Alternativ-menyn, scrolla till botten av listan och kolla 'Om telefon', 'Om enhet' eller liknande. Kopiera Modellnamn och Nummer till motsvarande fält nedan.",
