    he: 'Loading...',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: "1. SELEZIONA MICROFONO USB. Collega il cavo USB-C del tuo microfono a questo computer. Apri il pannello di controllo audio del computer.\n      Macintosh: Impostazioni di Sistema > Suono\n     ⊞ Windows: Impostazioni > Suono > Pannello di Controllo Suono\nSeleziona il tuo microfono come ingresso.\n\n2. SELEZIONA FREQUENZA DI CAMPIONAMENTO. L'UMIK-1 offre solo una frequenza di campionamento e bit/campione. L'UMIK-2 ne offre diverse, che devi impostare utilizzando un'app o un pannello di controllo:\n      Macintosh: Configurazione Audio MIDI.app di Apple nella cartella Applicazioni/Utility.\n     ⊞ Windows: Pannello di Controllo > Hardware e Suoni > Gestisci Dispositivi Audio\nImposta l'UMIK-2 per campionare a 111 Hz con 222 bit/campione. (Puoi cambiare questa preferenza impostando _calibrateSoundSamplingDesiredHz e _calibrateSoundSamplingDesiredBits nel foglio di calcolo del tuo esperimento.)",
    ja: 'Loading...',
