      "1. Close your RIGHT eye. (This is the right side of the screen.)\n2. Use the arrow key ◀ to slide the flickering dot. While looking at the cross, monitor the flickering dot in the corner of your eye, and slide it left and right until it disappears into your blindspot.\n3. Hit the SPACE bar.\nNOTE: Keep your eye on the cross. The flickering dot won't disappear while your eye follows it.",
