      'IS THE TEST PHONE CONNECTED TO THE INTERNET?\n1. YES, Click OK below.\n2. Otherwise. CELL SERVICE:  If the phone’s cellular service connects to the internet, click OK.\n3. Otheriwise. WIFI: If cellular service is unavailable, connect to the internet via Wi-Fi and click OK.\n4. Otherwise. HOTSPOT: If the test phone is not your personal phone, and your personal phone has internet, they can share the connection.\n    * Wi-Fi Hotspot: If your personal phone is connected to the internet via cellular service, it can provide a Wi-Fi hotspot to the test phone. Once connected, click OK.\n    * Bluetooth Tethering: If your personal phone is using Wi-Fi for internet access, it can share this connection via Bluetooth. Enable Bluetooth (on iPhone) or Bluetooth tethering (on Android) on both phones, pair them via Bluetooth, and click OK.\n    * USB Tethering: If both phones are either iPhones or Androids, they can share the internet connection via a USB cable, if you have the right cable. Most phones use a USB-C connector, but the iPhone 14 and earlier use the Lightning connector. Connect the phones via the appropriate cable and click OK.\n5. NO INTERNET: If none of these options are available, first click OK and then “Can’t connect”.',
    ar: 'هل الهاتف الاختباري متصل بالإنترنت؟\n1. نعم، انقر على "موافق" أدناه.\n2. خلاف ذلك. خدمة الهاتف الخلوي: إذا كانت خدمة الهاتف الخلوي تتصل بالإنترنت، انقر على "موافق".\n3. خلاف ذلك. الواي فاي: إذا كانت خدمة الهاتف الخلوي غير متاحة، اتصل بالإنترنت عبر الواي فاي وانقر على "موافق".\n4. خلاف ذلك. نقطة الاتصال: إذا لم يكن الهاتف الاختباري هو هاتفك الشخصي، وكان هاتفك الشخصي متصلاً بالإنترنت، يمكنهم مشاركة الاتصال.\n    * نقطة اتصال واي فاي: إذا كان هاتفك الشخصي متصلاً بالإنترنت عبر خدمة الهاتف الخلوي، يمكنه توفير نقطة اتصال واي فاي للهاتف الاختباري. بمجرد الاتصال، انقر على "موافق".\n    * الربط عبر البلوتوث: إذا كان هاتفك الشخصي يستخدم الواي فاي للوصول إلى الإنترنت، يمكنه مشاركة هذا الاتصال عبر البلوتوث. قم بتمكين البلوتوث (على الآيفون) أو الربط عبر البلوتوث (على الأندرويد) على كلا الهاتفين، وقم بإقرانهما عبر البلوتوث، ثم انقر على "موافق".\n    * الربط عبر USB: إذا كان كلا الهاتفين إما آيفونات أو أندرويد، يمكنهما مشاركة الاتصال بالإنترنت عبر كابل USB، إذا كان لديك الكابل المناسب. معظم الهواتف تستخدم موصل USB-C، ولكن آيفون 14 وما قبله يستخدم موصل Lightning. قم بتوصيل الهاتفين عبر الكابل المناسب وانقر على "موافق".\n5. لا يوجد إنترنت: إذا لم تكن أي من هذه الخيارات متاحة، انقر أولاً على "موافق" ثم "لا يمكن الاتصال".',
