    es: '¿ESTÁ EL TELÉFONO DE PRUEBA CONECTADO A INTERNET?\n1. SÍ, haga clic en OK a continuación.\n2. De lo contrario. SERVICIO CELULAR: Si el servicio celular del teléfono se conecta a internet, haga clic en OK.\n3. De lo contrario. WIFI: Si el servicio celular no está disponible, conéctese a internet a través de Wi-Fi y haga clic en OK.\n4. De lo contrario. HOTSPOT: Si el teléfono de prueba no es su teléfono personal, y su teléfono personal tiene internet, pueden compartir la conexión.\n    * Hotspot Wi-Fi: Si su teléfono personal está conectado a internet a través del servicio celular, puede proporcionar un hotspot Wi-Fi al teléfono de prueba. Una vez conectado, haga clic en OK.\n    * Anclaje Bluetooth: Si su teléfono personal está usando Wi-Fi para acceder a internet, puede compartir esta conexión a través de Bluetooth. Habilite Bluetooth (en iPhone) o anclaje Bluetooth (en Android) en ambos teléfonos, emparejarlos vía Bluetooth y haga clic en OK.\n    * Anclaje USB: Si ambos teléfonos son iPhones o Androids, pueden compartir la conexión a internet a través de un cable USB, si tiene el cable adecuado. La mayoría de los teléfonos usan un conector USB-C, pero el iPhone 14 y anteriores usan el conector Lightning. Conecte los teléfonos a través del cable apropiado y haga clic en OK.\n5. SIN INTERNET: Si ninguna de estas opciones está disponible, primero haga clic en OK y luego en “No se puede conectar”.',
