    fr: "CRÉER UNE PLATEFORME\nNous avons besoin d'une plateforme surélevée (une surface plane) pour poser votre téléphone. Cette plateforme peut être un verre, une tasse, un bocal, une boîte ou une pile de livres.\n\nPLACER LA PLATEFORME\n1. Si vous utilisez un ordinateur portable avec des haut-parleurs intégrés au clavier, placez votre plateforme sur la table entre vous et votre ordinateur, près du clavier.\n\n2. Si votre ordinateur a des haut-parleurs situés ailleurs, placez votre plateforme sur la table entre vous et les haut-parleurs de manière à ce que l'extrémité éloignée du téléphone sur votre plateforme soit à mi-chemin entre les haut-parleurs et vos yeux lorsque vous utilisez votre ordinateur.\n\nAJUSTER LA HAUTEUR DE LA PLATEFORME\nVous pouvez empiler des objets, comme des livres et un verre, pour atteindre la bonne hauteur. Faites en sorte que votre plateforme soit suffisamment haute pour être intermédiaire en hauteur entre les haut-parleurs et l'endroit où se trouvent vos yeux lorsque vous êtes assis à la table en utilisant votre ordinateur.\n\nPRÊT ?\nLorsque votre plateforme est prête, appuyez sur RETOUR ou cliquez sur CONTINUER pour continuer.",
