    it: "CREA UNA PIATTAFORMA\nAbbiamo bisogno di una piattaforma rialzata (una superficie piana) su cui appoggiare il telefono. Questa piattaforma può essere un bicchiere, una tazza, un barattolo, una lattina, una scatola o una pila di libri.\n\nPOSIZIONA LA PIATTAFORMA\n1. Se stai usando un laptop con altoparlanti integrati nella tastiera, posiziona la tua piattaforma sul tavolo tra te e il computer, vicino alla tastiera.\n\n2. Se il tuo computer ha altoparlanti situati altrove, posiziona la tua piattaforma sul tavolo tra te e gli altoparlanti in modo che l'estremità lontana del telefono sulla tua piattaforma sia a metà strada tra gli altoparlanti e i tuoi occhi quando usi il computer.\n\nREGOLA L'ALTEZZA DELLA PIATTAFORMA\nPuoi impilare oggetti, come libri e un bicchiere, per raggiungere l'altezza giusta. Rendi la tua piattaforma abbastanza alta da essere intermedia in altezza tra gli altoparlanti e dove si trovano i tuoi occhi quando sei seduto al tavolo usando il computer.\n\nPRONTO?\nQuando la tua piattaforma è pronta, premi INVIO o clicca su PROSEGUI per continuare.",
