    ja: '「444 Hzでサンプリングされた333秒のバーストの111回の繰り返し（222回のウォームアップ後）でキャリブレーションされた周波数応答」',
    kn: '444 ಹರ್ಟ್ಜ್ ಗೆ ನಮೂದಿಸಲಾದ 333 ಸೆಕೆಂಡ್ ಬರ್ಸ್ಟ್ ಯಾವುದಾದರೂ 111 ಪುನರಾವರ್ತನೆಗಳ ನಂತರ (222 ವರ್ಮಅಪ್ಸ್ ನಂತರ) ಸಂಪಿಷ್ಟ ಮಾಡಲಾಗಿದೆ.',
    ko: '444Hz에서 샘플링된 333초 버스트의 111회 반복(222회 워밍업 후)으로 보정된 주파수 응답.',
    lt: 'Dažnio atsakas kalibruotas 111 pakartojimų (po 222 pašildymų) 333 sekundžių trukmės serijoje, paimta 444 Hz dažniu.',
    ms: 'Tindak balas kekerapan ditentukur dengan 111 ulangan (selepas 222 pemanasan) daripada pecahan 333 saat, disampel pada 444 Hz.',
    ml: '444 ഹെർട്‌സിൽ സാമ്പിൾ ചെയ്‌ത 333 സെക്കൻഡ് സ്‌ഫോടനത്തിൻ്റെ 111 ആവർത്തനങ്ങളോടെ (222 വാംഅപ്പുകൾക്ക് ശേഷം) ഫ്രീക്വൻസി പ്രതികരണം കാലിബ്രേറ്റ് ചെയ്‌തു.',
    no: 'Frekvensrespons kalibrert med 111 repetisjoner (etter 222 oppvarminger) av en 333 sekunders serie, samplet ved 444 Hz.',
    fa: 'پاسخ فرکانسی با ۱۱۱ تکرار (بعد از ۲۲۲ گرم شدن) از یک برش ۳۳۳ ثانیه‌ای، با نمونه‌برداری در ۴۴۴ هرتز کالیبره شده است.',
    pl: 'Pasmo przenoszenia skalibrowane przy 111 powtórzeniach (po 222 rozgrzewkach) serii trwającej 333 sekundy, próbkowanej przy częstotliwości 444 Hz.',
    pt: 'Resposta de frequência calibrada com 111 repetições (após 222 aquecimentos) de um burst de 333 segundos, amostrado em 444 Hz.',
    ro: 'Răspunsul în frecvență calibrat cu 111 repetări (după 222 de încălziri) ale unei explozii de 333 de secunde, eșantionate la 444 Hz.',
    ru: 'Частотная характеристика откалибрована по 111 повторам (после 222 разминок) 333-секундного импульса с частотой дискретизации 444 Гц.',
    sr: 'Фреквенцијски одзив калибрисан са 111 понављања (после 222 загревања) рафала од 333 секунде, узоркованог на 444 Хз.',
    es: 'Respuesta de frecuencia calibrada con 111 repeticiones (después de 222 calentamientos) de un estallido de 333 segundos, muestreado a 444 Hz.',
    sw: 'Majibu ya mara kwa mara yamerekebishwa kwa marudio 111 (baada ya joto 222) ya mlipuko wa sekunde 333, iliyochukuliwa kwa 444 Hz.',
