    cs: 'Loading...',
    da: 'MAKSIMAL LYDSTYRKE. INGEN HØRETELEFONER. For præcis lydkalibrering, skal du maksimere lydstyrken på din computer nu, før kalibreringen, og så ikke røre ved lydstyrken indtil slutningen af eksperimentet.\nBRUG KAMERAET TIL AT FÅ QR-LINK. Når QR-koden vises nedenfor, skal du pege din smartphonekamera på den og klikke på linket, der vises på din smartphoneskærm. Følg derefter instruktionerne på smartphoneskærmen.\n——————————————————————————————————————————\nVÆR STILLE! OPTAGELSE I GANG. RØR IKKE VOLUMENKONTROLLEN.\n——————————————————————————————————————————\nPROBLEM?\n1. Hovedwebsiden, der kører EasyEyes på din bærbare computer, bruger webRTC-protokollen til at kommunikere med den QR-linkede webside på din smartphone. Denne protokol søger den bedste måde at forbinde på. Det bedste er, når din telefon og computer begge er på det samme WiFi-netværk.\n2. Hvis din smartphone rapporterer en fejl i forbindelsen, skal du prøve at afslutte og genstarte smartphone-browseren eller endda genstarte smartphone\'en.\n3. Det er sjældent, men hvis lyden ikke afspilles, eller hvis der ikke vises en "Fortsæt" knap efter afspilningen, betyder det, at kalibreringen mislykkedes. Du kan prøve igen ved at opdatere denne browser-side. Det plejer at gøre tricket.\n',
    nl: 'Loading...',
    'en-UK': 'Loading...',
    fi: 'MAKSIMIÄÄNI. EI KUULOKKEITA. Tarkkaa äänikalibrointia varten säädä tietokoneen äänenvoimakkuus nyt ennen kalibrointia, äläkä sitten koske äänenvoimakkuuteen ennen kokeen loppua.\nKÄYTÄ KAMERAASI QR-LINKIN SAAMISEEN. Kun QR-koodi ilmestyy alle, osoita älypuhelimen kamera siihen ja napsauta älypuhelimen näytöllä näkyvää linkkiä. Noudata sitten älypuhelimen näytöllä olevia ohjeita.\n——————————————————————————————————————————\nOLE HILJAA! NYT TALLENNETAAN. ÄLÄ KOSKE ÄÄNEN SÄÄTIMIIN.\n——————————————————————————————————————————\nONGELMA?\n1. EasyEyesin pääsivu kannettavassasi käyttää webRTC-protokollaa kommunikoidakseen QR-linkitetyn sivun kanssa älypuhelimessasi. Tämä protokolla etsii parhaan tavan yhdistää. Paras tapa on, kun puhelimesi ja tietokoneesi ovat samassa WiFi-verkossa.\n2. Jos älypuhelimesi ilmoittaa virheestä yhteydessä, kokeile lopettaa ja käynnistää älypuhelimen selain uudelleen tai jopa käynnistää älypuhelin uudelleen.\n3. Se on harvinaista, mutta jos ääni ei toistu tai toiston jälkeen Eteenpäin-painiketta ei ilmesty, se tarkoittaa, että kalibrointi epäonnistui. Voit yrittää uudelleen päivittämällä tämän selainikkunan. Se yleensä auttaa.',
    fr: "VOLUME MAXIMAL. SANS ÉCOUTEURS. Pour une calibration du son précise, veuillez maximiser le volume sonore de votre ordinateur maintenant, avant la calibration, puis ne touchez pas au volume jusqu'à la fin de l'expérience.\nUTILISEZ LA CAMÉRA DE L'UTILISATEUR POUR OBTENIR LE LIEN QR. Lorsque le code QR apparaît ci-dessous, pointez la caméra de votre smartphone dessus, et cliquez sur le lien qui apparaît sur l'écran de votre smartphone. Suivez ensuite les instructions sur l'écran de votre smartphone.\n——————————————————————————————————————————\nSILENCE S'IL VOUS PLAÎT ! ENREGISTREMENT EN COURS. NE TOUCHEZ PAS AU CONTRÔLE DU VOLUME.\n——————————————————————————————————————————\nUN PROBLÈME ?\n1. La page web principale qui exécute EasyEyes sur votre ordinateur portable utilise le protocole webRTC pour communiquer avec la page web liée au QR sur votre smartphone. Ce protocole cherche la meilleure des plusieurs manières de se connecter. La meilleure est lorsque votre téléphone et votre ordinateur sont tous les deux sur le même réseau WiFi.\n\n2. Si votre smartphone signale une erreur dans la connexion, essayez de quitter et de redémarrer le navigateur du smartphone, ou même de redémarrer le smartphone.\n\n3. C'est rare, mais si le son ne se joue pas, ou, après qu'il se soit joué, aucun bouton de procédure n'apparaît, cela signifie que la calibration a échoué. Vous pouvez essayer à nouveau en rafraîchissant cette page du navigateur. Cela fait généralement l'affaire.",
    de: 'Loading...',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'अधिकतम वॉल्यूम। कोई हेडफोन नहीं। सही ध्वनि समायोजन के लिए, कृपया कैलिब्रेशन से पहले अपने कंप्यूटर की ध्वनि वॉल्यूम को अधिक करें, और फिर अंत तक वॉल्यूम को छूने की कोशिश न करें।\nक्यूआर लिंक प्राप्त करने के लिए उपयोगकर्ता कैमरा का उपयोग करें। जब नीचे क्यूआर कोड दिखाई देता है, तो अपने स्मार्टफोन कैमरा को इस पर देखाएं, और अपने स्मार्टफोन स्क्रीन पर दिखाई देने वाले लिंक पर क्लिक करें। फिर स्मार्टफोन स्क्रीन पर दिए गए निर्देशों का पालन करें।\n——————————————————————————————————————————\nकृपया शांति! अब रिकॉर्डिंग हो रही है। वॉल्यूम नियंत्रण को छूने की कोशिश न करें।\n——————————————————————————————————————————\nसमस्या?\n1. आपके लैपटॉप पर चल रहे EasyEyes की मुख्य वेब पेज ने आपके स्मार्टफोन पर QR-लिंक वाले वेब पेज से बात करने के लिए webRTC प्रोटोकॉल का उपयोग किया है। यह प्रोटोकॉल कनेक्ट करने के कई तरीकों में से सबसे अच्छा तब होता है जब आपका फोन और कंप्यूटर दोनों एक ही WiFi नेटवर्क पर हों।\n2. अगर आपका स्मार्टफोन कनेक्शन में त्रुटि रिपोर्ट करता है, तो कोशिश करें कि स्मार्टफोन ब्राउज़र को बंद करके फिर से शुरू करें, या फिर स्मार्टफोन को रीस्टार्ट करें।\n3. यह बहुत कम होता है, लेकिन अगर ध्वनि नहीं बजती है, या बाद में बजती है, लेकिन कोई प्रोसीड बटन नहीं दिखाई देता है, तो इसका मतलब है कि कैलिब्रेशन विफल हो गया है। आप इस ब्राउज़र पेज को रिफ्रेश करके फिर से कोशिश कर सकते हैं। आमतौर पर यह काम कर जाता है।',
