    es: 'VOLUMEN MÁXIMO. SIN AURICULARES. Para una calibración precisa del sonido, por favor maximiza el volumen de sonido de tu computadora ahora, antes de la calibración, y luego no toques el volumen hasta el final del experimento.\nUSA LA CÁMARA PARA OBTENER EL ENLACE QR. Cuando el código QR aparezca abajo, apunta la cámara de tu smartphone hacia él y haz clic en el enlace que aparece en la pantalla de tu smartphone. Luego sigue las instrucciones en la pantalla del smartphone.\n——————————————————————————————————————————\n¡SILENCIO POR FAVOR! GRABANDO AHORA. NO TOQUES EL CONTROL DE VOLUMEN.\n——————————————————————————————————————————\n¿PROBLEMAS?\n1. La página web principal que ejecuta EasyEyes en tu laptop utiliza el protocolo webRTC para comunicarse con la página web vinculada al QR en tu smartphone. Este protocolo busca la mejor de varias maneras de conectar. Lo mejor es cuando tu teléfono y computadora están ambos en la misma red WiFi.\n\n2. Si tu smartphone informa de un error en la conexión, intenta cerrar y reiniciar el navegador del smartphone, o incluso reiniciar el smartphone.\n\n3. Es raro, pero si el sonido no se reproduce, o después de reproducirse, no aparece el botón de Proceder, significa que la calibración falló. Puedes intentarlo de nuevo actualizando esta página del navegador. Eso generalmente soluciona el problema.',
