    ar: 'شكرًا لك. لقد انتهيت. لا تغلق هذه النافذة. ستغلق تلقائيًا بمجرد حفظ بياناتك بأمان. إغلاق هذه النافذة سيمنع حفظ بياناتك، وسيتم فقدانها. قد يستغرق هذا بضع دقائق. شكرًا لصبرك.',
    hy: 'Loading...',
