    is: 'Loading...',
    id: 'Loading...',
    it: 'Grazie. Hai finito. NON CHIUDERE QUESTA FINESTRA. Si chiuderà automaticamente una volta che i tuoi dati saranno salvati in sicurezza. Chiudere questa finestra impedirà il salvataggio dei tuoi dati, e saranno persi. Questo potrebbe richiedere alcuni minuti. Grazie per la tua pazienza.',
    ja: 'Loading...',
    kn: 'ಧನ್ಯವಾದಗಳು. ನೀವು ಮುಗಿಸಿದ್ದೀರಿ. ಈ ಕಿಟಕಿಯನ್ನು ಮುಚ್ಚಬೇಡಿ. ನಿಮ್ಮ ಡೇಟಾ ಸುರಕ್ಷಿತವಾಗಿ ಉಳಿದಿದೆಯೇ ಹೇಗೆ ಮುಚ್ಚಿದರೆ ಆಗುವುದು. ಈ ಕಿಟಕಿಯನ್ನು ಮುಚ್ಚಿದರೆ ನಿಮ್ಮ ಡೇಟಾವನ್ನು ಉಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಮತ್ತು ಅವು ಕಳೆದುಹೋಗುವುವು. ಇದು ಕೆಲವು ನಿಮಿಷಗಳನ್ನು ತೆಗೆದುಕೊಳ್ಳಬಹುದು. ನಿಮ್ಮ ಧೈರ್ಯಕ್ಕೆ ಧನ್ಯವಾದಗಳು.',
    ko: '감사합니다. 작업이 완료되었습니다. 이 창을 닫지 마십시오. 데이터가 안전하게 저장된 후에 창이 닫힙니다. 이 창을 닫으면 데이터 저장이 중단되고 데이터가 손실될 수 있습니다. 몇 분 정도 소요될 수 있습니다. 기다려 주셔서 감사합니다.',
    lt: 'Ačiū. Jūsų darbas baigtas. NEUŽVIRKITE ŠIO LANGO. Jis užsidarys, kai jūsų duomenys bus saugiai išsaugoti. Uždarius šį langą, jūsų duomenys nebus išsaugoti ir bus prarasti. Tai gali užtrukti kelias minutes. Ačiū už jūsų kantrybę.',
