    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: 'È ora di raccontare una storia! Leggerai 111 pagine di un libro. Una volta iniziato, per favore leggi tutte le pagine in silenzio il più velocemente possibile, mantenendo una piena comprensione, fino a raggiungere la fine. Poi ti faremo alcune domande sulla storia. Su ogni pagina, premi la barra spaziatrice per passare alla pagina successiva. Quando sei pronto, premi la barra spaziatrice.',
    ja: 'Loading...',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'Pasakojimo laikas! Skaitysite 111 puslapius iš knygos. Kai pradėsite, prašome tyliai skaityti visus puslapius kuo greičiau, išlaikant visišką supratimą, kol pasieksite pabaigą. Tada užduosime jums kelis klausimus apie pasakojimą. Kiekvienam puslapiui paspauskite TARPO mygtuką, norėdami pereiti prie kito puslapio. Kai būsite pasiruošę, paspauskite TARPO mygtuką.',
