    de: 'Bei jedem Versuch hören Sie einen Satz und werden dann gebeten, sich an zwei der Wörter zu erinnern. Der Ton ist verzerrt und möglicherweise schwer zu erkennen, daher können Sie nicht alle richtig bekommen. Machen Sie sich keine Sorgen. Betrachten Sie es einfach als Spiel und geben Sie Ihr Bestes. Viel Glück. Drücken Sie RETURN oder klicken Sie auf WEITER, um fortzufahren.\n\nDer WEITER-Button verschwindet sofort und das Experiment beginnt, sobald die Klänge geladen sind, was je nach Geschwindigkeit der Internetverbindung 40 Sekunden oder länger dauern kann. Wir arbeiten daran, diese Verzögerung in einer zukünftigen Version zu verkürzen.\n\nKlänge werden geladen ...',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'Loading...',
