    no: 'På hvert forsøk vil du høre en setning, og så blir du bedt om å huske to av ordene. Lyden er forvrengt og kan være vanskelig å gjenkjenne, så du kan ikke få dem alle riktig. Ikke bekymre deg. Bare se på det som et spill og gjør ditt beste. Lykke til. Trykk på RETUR eller klikk FORTSETT for å fortsette.\n\nFORTSETT-knappen vil forsvinne umiddelbart, og eksperimentet vil begynne når lydene er lastet, noe som tar 40 sekunder eller lenger, avhengig av internettforbindelsens hastighet. Vi jobber med å forkorte denne forsinkelsen i en fremtidig utgivelse.\n\nLaster lyder ...',
    fa: 'Loading...',
